package com.methoduse;

public class Odd_No_Using_Method {
// odd no from 1 to 20
	public void Odd()
	{
		for(int i=1;i<=20;i++)
		{
			if(i%2!=0)
			{
				System.out.println(i);
			}
				
		}
	
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Odd_No_Using_Method obj=new Odd_No_Using_Method();
		obj.Odd();
		
		
		
		
		
	}

}
